$(document).ready(function(){$(".carousel").slick({centerMode:!0,centerPadding:"0",slidesToShow:3,slidesToScroll:1,responsive:[{breakpoint:1200,settings:{centerMode:!0,slidesToShow:2,slidesToScroll:1}},{breakpoint:900,settings:{slidesToShow:1,slidesToScroll:1}}]}),$("#form").submit(function(o){return!1}),$("#form").validate({rules:{email:{required:!0,email:!0,depends:function(){$("#form-email").css("border","2px #C9A059 solid")}},nome:{required:!0,depends:function(){$("#form-name").css("border","2px #C9A059 solid")}},texto:{required:!0,depends:function(){$("#form-text").css("border","2px #C9A059 solid")}}},submitHandler:function(o){alert("Seu contato foi submetido !")}}),$("#subirTopo").hide(),$("a#subirTopo").click(function(){return $("body,html").animate({scrollTop:0},200),!1}),$(window).scroll(function(){10<$(this).scrollTop()?$("#subirTopo").fadeIn():$("#subirTopo").fadeOut()})});